column567:
Sprawdzamy jakość tlenu w Iławie. #Zima, mróz, ludzie ogrzewają domy na potęgę, a efekty spalania wiszą w powietrzu. Powstaje rzeczywisty, nie jakiś urojony #smog. Gdzie jest najgorzej? Co wdychamy? Co możemy zrobić? Czy burmistrz pomoże mieszkańcom w wymianie pieców? Czytaj w gazecie KURIER IŁAWSKI. Strona 4. 

#Iława #powietrze #ogrzewanie
